            <h4>Viajar para outros paÃ­ses durante o intercambio Ã©â¦</h4>
            <button onClick={()=>{setResQuestion02(0)
             next()}} className='button-option01'>Essencial</button>
            <button onClick={()=>{setResQuestion02(1)
